import http from "../http";
import {useState, useEffect } from "react";

export default function home(){
    const [user, setUsers] = useState([]);

    useEffect(()=> {
        fetchAllUsers();
    },[]);

    fetchAllUsers = ()=>{
        http.get('/users').then(res=>{
            setUsers(res.data);
        })
    }
    return(
        <div>
            <h2>Users...</h2>
            <table className="table">
            <thead>
                <tr>
                    <th>ID</th>
                    <th>Name</th>
                    <th>Email</th>
                    <th>Action</th>
                </tr>
            </thead>
        </table>
        </div>
    )
}
